const ADD_POST = 'ADD-POST'
const UPDATE_NEW_POST_TEXT = 'UPDATE-NEW-POST-TEXT'
const ADD_MESSAGE = 'ADD-MESSAGE'
const UPDATE_NEW_MESSAGE_TEXT = 'UPDATE-NEW-MESSAGE-TEXT'


export let store = {
    _state: {
        profilePage: {

            posts: [
                {id: 1, message: 'Hello world', likeCount: 22},
                {id: 2, message: 'What happened?', likeCount: 666},
                {id: 3, message: 'Im here!', likeCount: 33}],
            newPostText: ''
        },
        dialogsPage: {
            dialogs: [
                {
                    id: 1,
                    name: 'Gupik',
                    ava: 'https://toppng.com/uploads/preview/pusheen-eating-pizza-11549658763y8nkdaf5cj.png'
                },
                {
                    id: 2,
                    name: 'Andrey',
                    ava: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQBYu0PIY_S8LOnc3jG1cGhlP2hm142QO3WgA&usqp=CAU'
                },
                {
                    id: 3,
                    name: 'Toha',
                    ava: 'data:image/jpeg;base64,'
                },
                {
                    id: 4,
                    name: 'Natasha',
                    ava: 'data:image/jpeg;base64,'
                },
                {
                    id: 5,
                    name: 'Nastya',
                    ava: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS_DTxL39p2Bd2cOFfc03OzpBY-GrWjFSctqQ&usqp=CAU'
                }],
            messages: [
                {id: 1, message: 'Hello'},
                {id: 2, message: 'How are u?'},
                {id: 3, message: 'Lets rock'},
                {id: 4, message: 'Who are u?'},
                {id: 5, message: 'Pfffff, okey'}
            ],
            newMessageText: ''
        }
    },
    _callSubscriber() {
        console.log('state changed')
    },

    getState() {
        debugger
        return this._state
    },
    subscribe(observer) {
        this._callSubscriber = observer
    },

    dispatch(action) {
        if (action.type === ADD_POST) {
            let newPost = {
                id: 123,
                message: this._state.profilePage.newPostText,
                likeCount: 0
            }
            this._state.profilePage.posts.unshift(newPost)
            this._state.profilePage.newPostText = ''
            this._callSubscriber(this._state)
        } else if (action.type === UPDATE_NEW_POST_TEXT) {
            this._state.profilePage.newPostText = action.newText
            this._callSubscriber(this._state)
        } else if (action.type === ADD_MESSAGE) {
            let newMessage = {
                id: 111,
                message: this._state.dialogsPage.newMessageText
            }
            this._state.dialogsPage.messages.push(newMessage)
            this._state.dialogsPage.newMessageText=''
            this._callSubscriber(this._state)
        } else if (action.type === UPDATE_NEW_MESSAGE_TEXT) {
            this._state.dialogsPage.newMessageText = action.newText
            this._callSubscriber(this._state)
        } else {
            alert('Something wrong')
        }

    }
}

export const addPostActionCreator = () => ({type: ADD_POST})
export const updateNewPostTextActionCreator = (text) =>
    ({type: UPDATE_NEW_POST_TEXT, newText: text})
export const updateNewMessageTextActionCreator = (text) =>
    ({type: UPDATE_NEW_MESSAGE_TEXT, newText: text})
export const addMessageActionCreator = () => ({type: ADD_MESSAGE})

window.store = store